script: |
  super -f text -I q911.spq | sort > q911.out

inputs:
  - name: q911.spq
    data: |
      SELECT COUNT ( * ) / COUNT ( * ) + 31 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 - + col0 + - 52 - + col0 * + col0 / + col0 NOT BETWEEN + 32 AND - 13;
  - name: tab1

outputs:
  - name: q911.out
    data: |
      32
